import React from 'react';

 import { Background, CardOverlay, Container, Item , Image, Name, CardContent, About, AboutText, Text} from './styles';

 interface Props {
     id: string;
     name: string;
     specie: string;
     age: string;
 }

const ListingItem: React.FC<Props> = ({
    id,
    name,
    specie,
    age,
    ...Props
}) => {

    const linkPet = `/pet/${id}`;
    console.log(id);
  return (
      <Container>
          <Item to={linkPet}>
            <Background>
                <Image src="https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fscitechdaily.com%2Fimages%2FCat-COVID-19-Mask.jpg&f=1&nofb=1" ></Image>
                <CardOverlay>
                    <Name>{name}</Name>
                </CardOverlay>
            </Background>
            <CardContent>
                <About>
                    <AboutText>
                        <Text>{specie}</Text>
                    </AboutText>
                    <AboutText>
                        <Text>{age}</Text>
                    </AboutText>
                </About>
            </CardContent>
            </Item>
      </Container>

  );
}

export default ListingItem;
